import React from 'react';
import styled from 'styled-components';

const ProjectsSection = styled.section`
  padding: 4em;
  background: #f4f4f4;
  color: #333;
`;

const ProjectCard = styled.div`
  padding: 1em;
  border: 1px solid #ddd;
  margin: 1em 0;
  background: white;
  transition: transform 0.3s ease;

  &:hover {
    transform: scale(1.05);
  }
`;

export const Projects = () => {
  return (
    <ProjectsSection>
      <h2>Projects</h2>
      <ProjectCard>
        <h3>Virtual Dressing Room</h3>
        <p>Try on clothes virtually using Python, AIML, and OpenCV.</p>
      </ProjectCard>
      <ProjectCard>
        <h3>Attendance System</h3>
        <p>A Java-based system for managing students and faculty.</p>
      </ProjectCard>
    </ProjectsSection>
  );
};
